// src/App.js

import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import "./components/styles/styles.css"; // Import the central style.css file
import Home from "./components/Home";
import Analysis from "./components/Analysis";
import Watchlist from "./components/Watchlist";
import Nav from "./components/Nav";

const App = () => {
  return (
    <Router>
      <div className="app">
        <header>{/* <h1>Trading App</h1> */}</header>
        <Nav />
        <main>
          <Switch>
            <Route path="/" exact>
              <Home />
            </Route>
            <Route path="/analysis">
              <Analysis />
            </Route>
            <Route path="/watchlist">
              <Watchlist />
            </Route>
          </Switch>
        </main>
      </div>
    </Router>
  );
};

export default App;
